    [],nt"revision_timestamp": "2015-05-07T00:58:17.903981",nt"name": "compact-ultrasensitive-so2-monitor-project",nt"isopen":
    true,nt"url": null,nt"notes": "This Small Business Innovative Research
    Phase I proposal seeks to develop an ultrasensitive, laser-based sulfur dioxide
    gas sensor system for airborne and ground-based atmospheric monitoring. The proposed
    instrument will be capable of accurately determining sub-parts-per-billion SO2 concentrations
    in seconds.  This compact, instrument will be capable of long-term autonomous operation
    and have modest power requirements. The Phase I research will demonstrate the feasibility
    of the technology by performing measurements on SO2 samples using a bench-scale
    laboratory instrument that employs a novel, frequency agile UV laser source.  The
    results of these tests will be used to quantify detection limits for a Phase II
    instrument. Commercial systems based on the Phase II prototype will be developed
    and marketed during Phase III.",nt"license_title": "U.S. Government Work",nt"extras":
